import React from 'react';
import { Link } from 'react-router-dom';

const NavBar: React.FC = () => {
  return (
    <nav>
      <ul>
        <li>
          <Link to="/test1">Homepage</Link>
        </li>
        <li>
          <Link to="/test2">Test2</Link>
        </li>
        <li>
          <Link to="/test3">Test3</Link>
        </li>
      </ul>
    </nav>
  );
};

export default NavBar;
